function esgRating(text) {
    let output = {};
    for (let name of Object.keys(ratings)) {
        if (text.indexOf(name) >= 0) {
            output[name] = ratings[name];
        }
    }
    return output;
    // return text.match(regex);
}

chrome.runtime.onMessage.addListener(messageReceived);

